function CaesarCipher($text, $oaksodkaoskdok) {
    $output = ""
    foreach ($char in $text.ToCharArray()) {
        if ($char -ge 'A' -and $char -le 'Z') {
            $output += [char]((( [int][char]$char + $oaksodkaoskdok - [int][char]'A' ) % 26) + [int][char]'A')
        } elseif ($char -ge 'a' -and $char -le 'z') {
            $output += [char]((( [int][char]$char + $oaksodkaoskdok - [int][char]'a' ) % 26) + [int][char]'a')
        } else {
            $output += $char
        }
